import React from 'react';

const AboutPage: React.FC = () => {
  return (
    <article className="about">
    <div>
      <h2>Hello! I am Neill</h2>
      <p>I should just juump right into my professional accolades, but those are much easier to find on LinkedIn and other pages of this site. </p>
    </div>
    </article>
  );
};

export default AboutPage;
